import React, { useState } from 'react';
import TextField from '@material-ui/core/TextField';

const SearchForm = (setSearchQueryFromForm) => {
    const [querySearch, setQuerySearch] = useState("");

    const handleSubmit = (event) => {
        setSearchQueryFromForm(querySearch)
        event.preventDefault();
        alert("You are submitting " + querySearch);
    }

    const changeHandler = (event) => {
        setQuerySearch(event.target.value);
      }

    return (
        <React.Fragment>
            <form noValidate autoComplete="off" onSubmit={e => { handleSubmit(e) }} >
                <TextField id="outlined-basic" label="Outlined" variant="outlined" onChange={e => setQuerySearch(e.target.value)} />
            </form>

        </React.Fragment>
    );
}

export default SearchForm;
